import logo from './logo.svg';
import './App.css';

function App() {
    return ( <
        div className = "App" >
        <
        header className = "App-header" >
        <
        img src = { logo }
        className = "App-logo"
        alt = "logo" / >
        <
        Title / >
        <
        Avatar / >
        <
        /header> <
        /div>
    );
}

class Title extends React.Component {
    render() {
        return ( <
            div >
            <
            p > REACT JS < /p> <
            /div>
        )
    }
}
class Avatar extends React.Component {
    render() {
        return ( <
            div >
            <
            img src = "Scr.jpg" > < /img> <
            /div>
        )
    }
}

export default App;
